import React from 'react';

const Header = () => (
  <header className="header fixed-top bg-white shadow-sm py-2">
    <div className="container d-flex justify-content-between align-items-center">
      <a href="#" className="d-flex align-items-center text-decoration-none">
        <ion-icon
          name="barbell-sharp"
          style={{
            color: "#f44336",
            fontSize: 40,
            transform: "rotate(90deg) translate(-2px, -5px)",
          }}
          aria-hidden="true"
        />
        <span
          className="ms-2 fw-bold"
          style={{
            fontFamily: "'Catamaran', sans-serif",
            fontSize: "2.8rem",
            color: "#152947",
          }}
        >
          Fitlife
        </span>
      </a>

      <nav className="d-none d-lg-block">
        <ul className="nav">
          {["Home", "About Us", "Classes", "Blog", "Contact Us"].map((text, idx) => (
            <li key={idx} className="nav-item">
              <a
                href={`#${text.toLowerCase().replace(" ", "")}`}
                className={`nav-link px-3 ${idx === 0 ? "active fw-bold" : ""}`}
              >
                {text}
              </a>
            </li>
          ))}
        </ul>
      </nav>

      <a
        href="/register"
        className="btn btn-outline-danger d-none d-lg-inline-block text-uppercase px-4 fw-semibold"
      >
        Join Now
      </a>
    </div>
  </header>
);

export default Header;
